var ctx = document.getElementsByTagName("canvas")[0].getContext("2d");



//TEST
function getBimap(url){
    return new Promise(function(enj, rdj){
        var img = document.createElement("img");
        img.src = url;
        img.onload = function(){
            var canvas = document.createElement("canvas");
            var context = canvas.getContext("2d");
            canvas.width = img.width;
            canvas.height = img.height;
            context.drawImage(img, 0, 0);
            enj(context.getImageData(0, 0, img.width, img.height));
        }
    });
}

(function(){
    getBimap("data:image/png;base64,").then(function(img){
        ctx.putImageData(img, 0, 0)
        var blurrer = new blur(ctx);
        blurrer.setThreads(3)
        blurrer.radius = 45
        blurrer.blur().render(function(data){
            console.log(data)
        })
    })
})()